import { useState, React } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import "./SolInst.css";
import Card from "react-bootstrap/Card";

const SolInstEvent = ({ event }) => {
  const [showSolInstEvent, setShowSolInstEvent] = useState(false);

  return (
    <div className="solInsts-events">
      <Card>
        <Card.Header className="cardTitle">
          {event.name}
          {showSolInstEvents === false ? (
            <div className="cardButton">
              <Link
                to="/solidarity_institutions/events"
                className="btn btn-primary"
                onClick={() => setShowSolInstEvent(!showSolInstEvents)}
              >
                Events
              </Link>
            </div>
          ) : (
            <div className="cardButton">
              <Link
                to="/solidarity_institutions"
                className="btn btn-primary"
                onClick={() => setShowSolInstEvent(!showSolInstEvents)}
              >
                Fechar
              </Link>
            </div>
          )}
        </Card.Header>
      </Card>
    </div>
  );
};

export default SolInstEvent;
